import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";
import axios from "axios";

import LoginForm from "./compoments/login";
import serviceForm from "./compoments/service";
import MainPage from "./compoments/load";
import Dashboard from "./compoments/admin";
import Header from "./common/header";
import Booked from "./compoments/book";
import Confirmed from "./compoments/confirmed";

import "./App.css";

const apiEndpoint = "http://localhost:3030/api/services";

class App extends Component {
  state = {
    services: [],
  };

  async componentDidMount() {
    const { data: services } = await axios.get(apiEndpoint);
    this.setState({ services });
  }

  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div>
            <Header />
            <div className="content">
              <Switch>
                <Route path="/confirmed" component={Confirmed} />
                <Route path="/service" component={serviceForm} />
                <Route path="/LogIn" component={LoginForm} />
                <Route
                  path="/Dashboard"
                  render={() => <Dashboard apiEndpoint={apiEndpoint} />}
                />
                <Route path="/Booked" component={Booked} />
                <Route path="/" component={MainPage} />
              </Switch>
            </div>
          </div>

          {/* <LoginForm /> */}

          {/* <Dashboard /> */}
          {/* */}
        </main>
      </React.Fragment>
    );
  }
}

export default App;
